import "../../styles/Project.css";

const Project = (props) => {
    return (
        <div className="projectContainer">
            <div className="projectContainer-header"></div>
            <div className="projectContainer-desc"></div>
            <div className="projectContainer-footer"></div>
        </div>
    );
}

export default Project;
